    @Getter
    @Setter
    @Struct
    public static class Bill {

        private Cuchar bid;

        @Override
        public String toString() {
            return "Bill{" + "bid='" + bid + '\'' + '}';
        }
    }

    @Data
    @Struct
    public static class Wife {

        @ToString(bufferLength = 2)
        private String name;
    }

    @Data
    @Struct
    public static class Son<T> {

        @ToString(bufferLength = 2)
        private T name;

    }

    @Getter
    @Setter
    @Struct
    public static class User<T, W>  {

        private Clong4 uid;
        private Cchar uname;
        private Cint isMarried;
        private Cchar sex;
        private Cfloat address;
        private Cdouble platformId;
        private Clong8 description;
        private Culong8 interest;
        private Bill bill;
        private Cchar Cchar;
        private Cdouble Cdouble;
        private Cfloat Cfloat;
        private Cint Cint;
        private Clong4 Clong4;
        private Clong8 Clong8;
        private Clonglong Clonglong;
        private Cshort Cshort;
        private Cuchar Cuchar;
        private Cuint Cuint;
        private Culong4 Culong4;
        private Culong8 Culong8;
        private Culonglong Culonglong;
        private Cushort Cushort;
        private Cpp8tchar Cpp8tchar;
        private Cpp16tchar Cpp16tchar;
        private Cpp32tchar Cpp32tchar;
        private Cppdouble Cppdouble;
        private Cppfloat Cppfloat;
        private Cppint Cppint;
        private Cpplong4 Cpplong4;
        private Cpplong8 Cpplong8;
        private Cpplonglong Cpplonglong;
        private Cppshort Cppshort;
        private Cppuchar Cppuchar;
        private Cppuint Cppuint;
        private Cppulong4 Cppulong4;
        private Cppulong8 Cppulong8;
        private Cppulonglong Cppulonglong;
        private Cppushort Cppushort;
        private CppBool cppBool;

        @ToArray(length = 2)
        private Cchar[] loginNames;
        @ToArrayList(elementType = Wife.class, size = 2)
        private List<W> wifes;
        @ToHashSet(elementType = Son.class, size = 1)
        private Set<T> sons;

        @Override
        public String toString() {
            return "User{" + "uid=" + uid + ", uname=" + uname + ", isMarried=" + isMarried + ", sex=" + sex
                + ", address=" + address + ", platformId=" + platformId + ", description=" + description + ", interest="
                + interest + ", bill=" + bill + ", Cchar=" + Cchar + ", Cdouble=" + Cdouble + ", Cfloat=" + Cfloat
                + ", Cint=" + Cint + ", Clong4=" + Clong4 + ", Clong8=" + Clong8 + ", Clonglong=" + Clonglong
                + ", Cshort=" + Cshort + ", Cuchar=" + Cuchar + ", Cuint=" + Cuint + ", Culong4=" + Culong4
                + ", Culong8=" + Culong8 + ", Culonglong=" + Culonglong + ", Cushort=" + Cushort + ", Cpp8tchar="
                + Cpp8tchar + ", Cpp16tchar=" + Cpp16tchar + ", Cpp32tchar=" + Cpp32tchar + ", Cppdouble=" + Cppdouble
                + ", Cppfloat=" + Cppfloat + ", Cppint=" + Cppint + ", Cpplong4=" + Cpplong4 + ", Cpplong8=" + Cpplong8
                + ", Cpplonglong=" + Cpplonglong + ", Cppshort=" + Cppshort + ", Cppuchar=" + Cppuchar + ", Cppuint="
                + Cppuint + ", Cppulong4=" + Cppulong4 + ", Cppulong8=" + Cppulong8 + ", Cppulonglong=" + Cppulonglong
                + ", Cppushort=" + Cppushort + ", cppBool=" + cppBool + ", loginNames=" + Arrays.toString(loginNames)
                + ", wifes=" + 1 + ", sons=" + 1 + '}';
        }
    }
